import React, { Component } from "react";
import Globalcn from "./components/global_cn";
import "./App.css";
//import { PLACEHOLDERS_FLIPPED_ALIAS } from "@babel/types";

import Bsnscn from "./components/bsns_cn";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
import Alertdialog from './components/dialogbox';
import Cnmanager from "./components/backend_cnmanager";
import Setupmanager from "./components/backend_setup";
import Invmanager from "./components/backend_invmanager";
import Admanager from "./components/backend_admanager";



class App extends Component {

  state = {
    dialog:{
      status:false, 
      msg:""
    }
  };


  handleDialogClose = () => {
    var tmpState = this.state;
    tmpState.dialog.status = false;
    this.setState(tmpState);
  }

  render() {

    return (
      <div>
      <Alertdialog dialog={this.state.dialog} onClose={this.handleDialogClose}/>
      <Router>
        <Switch>
          <Route
            path="/setup/"
            render={(props) => (
              <Setupmanager
                title="Setup-2.0"
              />
            )}
          />
          <Route
            path="/cnmanager/"
            render={(props) => (
              <Cnmanager
                title="CnManager-2.0"
              />
            )}
          />
          <Route
            path="/invmanager/"
            render={(props) => (
              <Invmanager
                title="InvManager-2.0"
              />
            )}
          />
          <Route
            path="/admanager/"
            render={(props) => (
              <Admanager
              title="AdManager-2.0"
              />
            )}
          />
          <Route
            path="/sites/:siteid"
            render={(props) => (
              <Bsnscn
                siteid={props.match.params.siteid}
              />
            )}
          />
          <Route
            exact
            path="/"
            render={(props) => (
              <Globalcn/>
            )}
          />
        </Switch>
      </Router>
      </div>
    );


  }
}

export default App;
